import React from "react";
import { watchlist } from "../data/data";
import "./WatchList.css";

const WatchList = () => {
  return (
    <div className="watchlist-wrapper">

      {/* Search */}
      <div className="watch-search">
        <input placeholder="Search eg: INFY, NIFTY, GOLD" />
        <span>{watchlist.length} / 50</span>
      </div>

      {/* List */}
      <ul className="watch-items">

        {watchlist.map((w, i) => (
          <li key={i} className="watch-row">

            <div className="left">
              <strong>{w.name}</strong>
            </div>

            <div className="right">
              <span className="price">{w.price}</span>
              <span className={w.isDown ? "down" : "up"}>
                {w.percent}
              </span>
            </div>

          </li>
        ))}

      </ul>

    </div>
  );
};

export default WatchList;
